const Navber = () => {
  return (
    <Fragment>
      <Nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/About">About</Link>
          </li>
          <li>
            <Link to="/Contact">Contact</Link>
          </li>
          </ul>
      </Nav>
      <Outlet /> 
    </Fragment>
  )
}
export default Navber;
